const int brcm_patch_ram_length = sizeof(brcm_patchram_buf);

int brcm_patch_offset;

struct k_timer brcm_reset_cmd_timeout_timer;

static int brcm_download_firmware_process(void)
{
    int cur = brcm_patch_offset;
    //printk("brcm_download_firmware_process, cur: %d, length: %d\n", cur, brcm_patch_ram_length);
    if(cur != brcm_patch_ram_length)
    {
        struct net_buf *buf;
        const uint8_t* hci_data = brcm_patchram_buf + cur;

        struct bt_hci_cmd_hdr *hdr = (void *)hci_data;
        buf = bt_hci_cmd_create(hdr->opcode, hdr->param_len);
        //printk("brcm_download_firmware_process, buf: 0x%x, op: 0x%x, len: 0x%x\n", buf, hdr->opcode, hdr->param_len);
        if (!buf)
        {
            return -1;
        }

        net_buf_add_mem(buf, hci_data + 3, hdr->param_len);

        bt_hci_cmd_send(hdr->opcode, buf);

        // update offset
        brcm_patch_offset += hdr->param_len + 3;

        return 0;
    }

    return 1;
}

void brcm_send_reset_cmd(void)
{
    k_timer_start(&brcm_reset_cmd_timeout_timer, K_MSEC(100), Z_TIMEOUT_NO_WAIT);
    bt_hci_cmd_send(BT_HCI_OP_RESET, NULL);
}
void boot_start(void)
{
    state = STATE_POLLING_BOOTING;

    step = 1;

    brcm_send_reset_cmd();
}

void prepare_start(void)
{
    state = STATE_POLLING_PREPARING;
    // nothing todo, just update state
    bt_hci_set_prepare_ready();
}


void brcm_reset_cmd_timeout(struct k_timer *timer)
{
    printf("brcm_reset_cmd_timeout()\n");
    brcm_send_reset_cmd();
}

void init_work(void)
{
    state = STATE_POLLING_BOOTING;
    step = 0;

    k_timer_init(&brcm_reset_cmd_timeout_timer, brcm_reset_cmd_timeout, NULL);
}

void event_process(uint8_t event, struct net_buf *buf)
{
    k_timer_stop(&brcm_reset_cmd_timeout_timer);
    //printk("event_process, state: %d, step: %d, event: 0x%x\n", state, step, event);
    if(state == STATE_POLLING_BOOTING)
    {
        if ((event == BT_HCI_EVT_VENDOR) ||
            (event == BT_HCI_EVT_CMD_COMPLETE))
        {
            switch (step)
            {
            case 1:
                // Start Download Work
                bt_hci_cmd_send(0xfc2e, NULL);
                step = 2;
                break;
            case 2:
                if(brcm_download_firmware_process() == 1)
                {
                    brcm_send_reset_cmd();
                    step = 3;
                }
                break;
            case 3:
                bt_hci_set_boot_ready();
                break;
            }
        }
    }
}

static const struct bt_hci_chipset_driver chipset_drv = {
        init_work, boot_start, prepare_start, event_process,
};

// public API
const struct bt_hci_chipset_driver *bt_hci_chipset_impl_local_instance(void)
{
    return &chipset_drv;
}

const bt_usb_interface_t *bt_chipset_get_usb_interface(void)
{
    return NULL;
}

static const bt_uart_interface_t uart_interface = {115200, 8, 1, 0, true};
const bt_uart_interface_t *bt_chipset_get_uart_interface(void)
{
    return &uart_interface;
}
